import { Link } from "react-router-dom";
import Input from "../components/Input";

export default function Login() {
  return (
    <div
      className="container mt-4 d-flex justify-content-center"
      style={{
        zIndex: 1,
        position: "relative",
        paddingBottom: "80px",
        paddingTop: "80px",
      }}
    >
      <form
        className="form-group p-4 border rounded"
        style={{ maxWidth: "400px" }}
      >
        <h2 className="text-center mb-4">Login</h2>
        {/* {errorMessages.allFields && <Error message={errorMessages.allFields} />} */}
        <Input
          type="email"
          name="email"
          label="Email"
        //   value={formData.email}
        //   onChange={handleChange}
        //   errorMessage={errorMessages.email}
        />
        <Input
          type="password"
          name="password"
          label="Password"
        //   value={formData.password}
        //   onChange={handleChange}
        //   errorMessage={errorMessages.password}
        />
        <button className="btn btn-block button-style" type="submit">
          Login
        </button>
        <p className="mt-3">
          New User? <Link to="/">Signup here</Link>
        </p>
      </form>
    </div>
  );
}
